import axios from 'axios'

const fetch = (url) => {
    return axios.get(url).then(response => {
        return response.data
    })
}

const create = (url, payload) => {
    return axios.post(url, payload).then(response => {
        return response
    })
}

export {
    fetch,
    create
}
